using System;
using Microsoft.VisualStudio.TestTools.UnitTesting;
using System.IO;
using System.Collections.Generic;
using System.Globalization;
using System.Diagnostics;

namespace ApiFP.Tests
{
    [TestClass]
    public partial class PDFParserSistemasAdministrativosTests
    {
        CultureInfo culture = new CultureInfo("es-ES");

        static Dictionary<string, string> _facturas = new Dictionary<string, string>
        {
            {"SA01", ""}
        };

        [TestMethod]
        public void Parse01()
        {
            var factura = new Infrastructure.Factura();
            factura.Parse(_facturas["SA01"]);
            Assert.IsTrue(factura.Numero == "0006-00463837");
            Assert.IsTrue(factura.Tipo == "B");
            Assert.IsTrue(factura.CuitOrigen == "30583701040");
            //Assert.IsTrue(factura.Importe == "1457.00");
            Assert.IsTrue(factura.CuitDestino == "20315762694");
            Assert.IsTrue(factura.Fecha == DateTime.Parse("02/01/2020", culture));
            Console.WriteLine($"DETALLE FACTURA: {factura.Detalle}");
        }        
    }
}
